(31, 53, '_form', '<style>\n#wpcf7-f53-o1 p { width: 100% } #wpcf7-f53-o1 span.wpcf7-not-valid-tip { text-align: left; }\n</style>\n\n<div class=\"row\">\n        <div class=\"col-lg-4 col-md-6 offset-lg-2\">\n          <div class=\"input-group\">[text* your-name class:form-control placeholder \"Your Name\"]</div>\n        </div>\n        <div class=\"col-lg-4 col-md-6\">\n          <div class=\"input-group\">[text company-name class:form-control placeholder \"Company\"]</div>\n        </div>\n        <div class=\"col-lg-4 col-md-6 offset-lg-2\">\n          <div class=\"input-group\">[email* your-email class:form-control placeholder \"Email\"] </div>\n        </div>\n        <div class=\"col-lg-4 col-md-6\">\n          <div class=\"input-group\">[tel your-number class:form-control placeholder \"Phone no.\"]</div>\n        </div>\n        <div class=\"col-lg-8 offset-lg-2\">\n          <div class=\"input-group\">[select* business-type id:list class:ddl-select first_as_label \"What business unit do you want to contact?\" \"One\" \"Two\"]\n          </div>\n        </div>\n        <div class=\"col-lg-8 offset-lg-2\">\n          <div class=\"input-group\">[select* business-budget id:list2 class:ddl-select first_as_label \"What is your budget?\" \"One\" \"Two\"]\n          </div>\n        </div>\n<div class=\"col-lg-8 offset-lg-2\">\n          <div class=\"input-group\">[select* project-timeframe id:list3 class:ddl-select first_as_label \"What sort of timeframe do you require the campaign within?\" \"One\" \"Two\"]\n          </div>\n        </div>\n        <div class=\"col-lg-8 offset-lg-2\">\n          <div class=\"input-group\">[text* project-details class:form-control placeholder \"Project Details\"]\n          </div>\n        </div>\n        <div class=\"col-lg-8 offset-lg-2\">\n          <div class=\"input-group mt-3\">\n            [submit class:btn class:btn-outline-white \"SEND\"] \n          </div>\n        </div>\n      </div>'),
(32, 53, '_mail', 'a:9:{s:6:\"active\";b:1;s:7:\"subject\";s:13:\"[_site_title]\";s:6:\"sender\";s:37:\"[_site_title] <info@convertbunny.com>\";s:9:\"recipient\";s:22:\"usman@convertbunny.com\";s:4:\"body\";s:218:\"From: [your-name] [your-email]\n\nCompany Name: [company-name]\nPhone Number: [your-number]\nBusiness Type: [business-type]\nBudget: [business-budget]\nProject Timeline: [project-timeframe]\nProject Details: [project-details]\";s:18:\"additional_headers\";s:22:\"Reply-To: [your-email]\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";b:0;s:13:\"exclude_blank\";b:1;}'),
