(70, 7, '_hb_left_title', 'field_641df58a96f81'),
(71, 7, 'hb_left_subtitle', 'Rabbit-pace growth for your business. ConvertBunny\'s data-driven digital marketing services help you stay ahead of the game with higher ROI and customer engagement.'),
(72, 7, '_hb_left_subtitle', 'field_641df59c96f82'),
(73, 7, 'hb_middle_description', 'You\'re a savvy business owner - you know the importance of digital marketing. But let\'s face it, online success can be tough to achieve. That\'s where <b>ConvertBunny</b> comes in.'),
(74, 7, '_hb_middle_description', 'field_641df5c596f83'),
(75, 7, 'hb_left_image', '74'),
(76, 7, '_hb_left_image', 'field_641df5ff96f84'),
(77, 7, 'hb_right_image', '73'),
(78, 7, '_hb_right_image', 'field_641df61496f85'),
(79, 7, 'p_title', 'ConvertBunny: Your Partner\r\nfor All Things Digital'),
(80, 7, '_p_title', 'field_641df65552341'),
(81, 7, 'p_description', 'Don\'t let the competition out-hop you - let ConvertBunny help you reach your business goals and achieve digital marketing success.'),
(82, 7, '_p_description', 'field_641df68452342'),
(83, 7, 'p_image', '79'),
(84, 7, '_p_image', 'field_641df79d11513'),
(85, 7, 'partner_services_0_title', 'BRANDING'),
(86, 7, '_partner_services_0_title', 'field_641df75c11511'),
(87, 7, 'partner_services_0_description', 'Your brand is more than just a logo - it\'s your voice, your values, and your unique identity. Let ConvertBunny help you build a brand that\'s as distinctive as you are.'),
(88, 7, '_partner_services_0_description', 'field_641df76b11512'),
(89, 7, 'partner_services', '5'),
(90, 7, '_partner_services', 'field_641df72011510'),
(91, 7, 'prtnr_title', 'YOUR PERSONAL \r\nRAY OF SUNSHINE'),
(92, 7, '_prtnr_title', 'field_641df82b0bf84'),
(93, 7, 'prtnr_description', 'At ConvertBunny, we don\'t believe in one-size-fits-all solutions. We take a customized approach to every project we work on, just so you have your personal sunny spot! Here\'s how we do it:'),
(94, 7, '_prtnr_description', 'field_641df8410bf85'),
(95, 7, 'prtnr_process_1_title', 'CONCEPT'),
(96, 7, '_prtnr_process_1_title', 'field_641df85a0bf86'),
(97, 7, 'prtnr_process_1_description', 'We hold a meet and greet with you and try to learn all we can about your business. We listen to your goals, ask questions, and gain a deep understanding of your brand\'s values and mission. This helps us develop a customized plan that\'s perfectly aligned with your business objectives.'),
(98, 7, '_prtnr_process_1_description', 'field_641df87e0bf87'),
(99, 7, 'prtnr_process_2_title', 'BUDGET'),
(100, 7, '_prtnr_process_2_title', 'field_641df89a0bf88'),
(101, 7, 'prtnr_process_2_description', 'We all know money makes the world go round but don’t worry, we will catch you on the flip side and give\r\n                you a tailored plan as per your needs. We believe in transparency and will provide you with a detailed\r\n                breakdown of all costs upfront, so there are no surprises along the way.'),
(102, 7, '_prtnr_process_2_description', 'field_641df8b90bf89'),
(103, 7, 'prtnr_process_3_title', 'DEVELOPEMENT'),
(104, 7, '_prtnr_process_3_title', 'field_641df8e00bf8c'),
(105, 7, 'prtnr_process_3_description', 'At this point of our engagement, we are both happy, often meet each other for drinks, and knit sweaters\r\n                together, unless we don’t send over the monthly report with goal completion. Therefore, we track\r\n                progress, analyze data, and send monthly reports that provide insights and celebrate successes. Our\r\n                ultimate goal is to help you achieve higher ROI, and we\'re committed to doing whatever it takes to get\r\n                you there (WHATEVER IT TAKES!).'),
(106, 7, '_prtnr_process_3_description', 'field_641df8c90bf8a'),
