INSERT INTO `cb_postmeta` (`meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(802, 84, 'partner_services_0_title', 'BRANDING'),
(803, 84, '_partner_services_0_title', 'field_641df75c11511'),
(804, 84, 'partner_services_0_description', 'Your brand is more than just a logo - it\'s your voice, your values, and your unique identity. Let ConvertBunny help you build a brand that\'s as distinctive as you are.'),
(805, 84, '_partner_services_0_description', 'field_641df76b11512'),
(806, 84, 'partner_services', '5'),
(807, 84, '_partner_services', 'field_641df72011510'),
(808, 84, 'prtnr_title', 'YOUR PERSONAL RAY OF SUNSHINE'),
(809, 84, '_prtnr_title', 'field_641df82b0bf84'),
(810, 84, 'prtnr_description', 'At ConvertBunny, we don\'t believe in one-size-fits-all solutions. We take a customized approach to every project we work on, just so you have your personal sunny spot! Here\'s how we do it:'),
(811, 84, '_prtnr_description', 'field_641df8410bf85'),
(812, 84, 'prtnr_process_1_title', 'CONCEPT'),
(813, 84, '_prtnr_process_1_title', 'field_641df85a0bf86'),
(814, 84, 'prtnr_process_1_description', 'We hold a meet and greet with you and try to learn all we can about your business. We listen to your goals, ask questions, and gain a deep understanding of your brand\'s values and mission. This helps us develop a customized plan that\'s perfectly aligned with your business objectives.'),
(815, 84, '_prtnr_process_1_description', 'field_641df87e0bf87'),
(816, 84, 'prtnr_process_2_title', 'BUDGET'),
(817, 84, '_prtnr_process_2_title', 'field_641df89a0bf88'),
(818, 84, 'prtnr_process_2_description', 'We all know money makes the world go round but don’t worry, we will catch you on the flip side and give\r\n                you a tailored plan as per your needs. We believe in transparency and will provide you with a detailed\r\n                breakdown of all costs upfront, so there are no surprises along the way.'),
(819, 84, '_prtnr_process_2_description', 'field_641df8b90bf89'),
(820, 84, 'prtnr_process_3_title', 'DEVELOPEMENT'),
(821, 84, '_prtnr_process_3_title', 'field_641df8e00bf8c'),
(822, 84, 'prtnr_process_3_description', 'At this point of our engagement, we are both happy, often meet each other for drinks, and knit sweaters\r\n                together, unless we don’t send over the monthly report with goal completion. Therefore, we track\r\n                progress, analyze data, and send monthly reports that provide insights and celebrate successes. Our\r\n                ultimate goal is to help you achieve higher ROI, and we\'re committed to doing whatever it takes to get\r\n                you there (WHATEVER IT TAKES!).'),
(823, 84, '_prtnr_process_3_description', 'field_641df8c90bf8a'),
(824, 84, 'prtnr_process_4_title', 'RESULT'),
(825, 84, '_prtnr_process_4_title', 'field_641df8ee0bf8d'),
(826, 84, 'prtnr_process_4_description', ' Our team of highly qualified and somewhat crazy specialists hit the labs to develop a vaccine for all\r\n                the pain points of your business. We brainstorm ideas, analyze data, take a lot of paracetamol, and come\r\n                up with a custom plan that delivers results and sets you apart.'),
(827, 84, '_prtnr_process_4_description', 'field_641df8d30bf8b'),
