(921, 95, '_prtnr_title', 'field_641df82b0bf84'),
(922, 95, 'prtnr_description', 'At ConvertBunny, we don\'t believe in one-size-fits-all solutions. We take a customized approach to every project we work on, just so you have your personal sunny spot! Here\'s how we do it:'),
(923, 95, '_prtnr_description', 'field_641df8410bf85'),
(924, 95, 'prtnr_process_1_title', 'CONCEPT'),
(925, 95, '_prtnr_process_1_title', 'field_641df85a0bf86'),
(926, 95, 'prtnr_process_1_description', 'We hold a meet and greet with you and try to learn all we can about your business. We listen to your goals, ask questions, and gain a deep understanding of your brand\'s values and mission. This helps us develop a customized plan that\'s perfectly aligned with your business objectives.'),
(927, 95, '_prtnr_process_1_description', 'field_641df87e0bf87'),
(928, 95, 'prtnr_process_2_title', 'BUDGET'),
(929, 95, '_prtnr_process_2_title', 'field_641df89a0bf88'),
(930, 95, 'prtnr_process_2_description', 'We all know money makes the world go round but don’t worry, we will catch you on the flip side and give\r\n                you a tailored plan as per your needs. We believe in transparency and will provide you with a detailed\r\n                breakdown of all costs upfront, so there are no surprises along the way.'),
(931, 95, '_prtnr_process_2_description', 'field_641df8b90bf89'),
(932, 95, 'prtnr_process_3_title', 'DEVELOPEMENT'),
(933, 95, '_prtnr_process_3_title', 'field_641df8e00bf8c'),
(934, 95, 'prtnr_process_3_description', 'At this point of our engagement, we are both happy, often meet each other for drinks, and knit sweaters\r\n                together, unless we don’t send over the monthly report with goal completion. Therefore, we track\r\n                progress, analyze data, and send monthly reports that provide insights and celebrate successes. Our\r\n                ultimate goal is to help you achieve higher ROI, and we\'re committed to doing whatever it takes to get\r\n                you there (WHATEVER IT TAKES!).'),
(935, 95, '_prtnr_process_3_description', 'field_641df8c90bf8a'),
(936, 95, 'prtnr_process_4_title', 'RESULT'),
(937, 95, '_prtnr_process_4_title', 'field_641df8ee0bf8d'),
(938, 95, 'prtnr_process_4_description', ' Our team of highly qualified and somewhat crazy specialists hit the labs to develop a vaccine for all\r\n                the pain points of your business. We brainstorm ideas, analyze data, take a lot of paracetamol, and come\r\n                up with a custom plan that delivers results and sets you apart.'),
(939, 95, '_prtnr_process_4_description', 'field_641df8d30bf8b'),
