(1647, 108, 'prtnr_description', 'At ConvertBunny, we don\'t believe in one-size-fits-all solutions. We take a customized approach to every project we work on, just so you have your personal sunny spot! Here\'s how we do it:'),
(1648, 108, '_prtnr_description', 'field_641df8410bf85'),
(1649, 108, 'prtnr_process_1_title', 'CONCEPT'),
(1650, 108, '_prtnr_process_1_title', 'field_641df85a0bf86'),
(1651, 108, 'prtnr_process_1_description', 'We hold a meet and greet with you and try to learn all we can about your business. We listen to your goals, ask questions, and gain a deep understanding of your brand\'s values and mission. This helps us develop a customized plan that\'s perfectly aligned with your business objectives.'),
(1652, 108, '_prtnr_process_1_description', 'field_641df87e0bf87'),
(1653, 108, 'prtnr_process_2_title', 'BUDGET'),
(1654, 108, '_prtnr_process_2_title', 'field_641df89a0bf88'),
