(1798, 120, '_hb_right_image', 'field_641df61496f85'),
(1799, 120, 'p_title', 'ConvertBunny: Your Partner\r\nfor All Things Digital'),
(1800, 120, '_p_title', 'field_641df65552341'),
(1801, 120, 'p_description', 'Don\'t let the competition out-hop you - let ConvertBunny help you reach your business goals and achieve digital marketing success.'),
(1802, 120, '_p_description', 'field_641df68452342'),
(1803, 120, 'p_image', '79'),
(1804, 120, '_p_image', 'field_641df79d11513'),
(1805, 120, 'partner_services_0_title', 'BRANDING'),
(1806, 120, '_partner_services_0_title', 'field_641df75c11511'),
(1807, 120, 'partner_services_0_description', 'Your brand is more than just a logo - it\'s your voice, your values, and your unique identity. Let ConvertBunny help you build a brand that\'s as distinctive as you are.'),
(1808, 120, '_partner_services_0_description', 'field_641df76b11512'),
(1809, 120, 'partner_services', '5'),
(1810, 120, '_partner_services', 'field_641df72011510'),
(1811, 120, 'prtnr_title', 'YOUR PERSONAL \r\nRAY OF SUNSHINE'),
(1812, 120, '_prtnr_title', 'field_641df82b0bf84'),
(1813, 120, 'prtnr_description', 'At ConvertBunny, we don\'t believe in one-size-fits-all solutions. We take a customized approach to every project we work on, just so you have your personal sunny spot! Here\'s how we do it:'),
(1814, 120, '_prtnr_description', 'field_641df8410bf85'),
(1815, 120, 'prtnr_process_1_title', 'CONCEPT'),
(1816, 120, '_prtnr_process_1_title', 'field_641df85a0bf86'),
(1817, 120, 'prtnr_process_1_description', 'We hold a meet and greet with you and try to learn all we can about your business. We listen to your goals, ask questions, and gain a deep understanding of your brand\'s values and mission. This helps us develop a customized plan that\'s perfectly aligned with your business objectives.'),
(1818, 120, '_prtnr_process_1_description', 'field_641df87e0bf87'),
(1819, 120, 'prtnr_process_2_title', 'BUDGET'),
(1820, 120, '_prtnr_process_2_title', 'field_641df89a0bf88'),
(1821, 120, 'prtnr_process_2_description', 'We all know money makes the world go round but don’t worry, we will catch you on the flip side and give\r\n                you a tailored plan as per your needs. We believe in transparency and will provide you with a detailed\r\n                breakdown of all costs upfront, so there are no surprises along the way.'),
(1822, 120, '_prtnr_process_2_description', 'field_641df8b90bf89'),
(1823, 120, 'prtnr_process_3_title', 'DEVELOPEMENT'),
(1824, 120, '_prtnr_process_3_title', 'field_641df8e00bf8c'),
(1825, 120, 'prtnr_process_3_description', 'At this point of our engagement, we are both happy, often meet each other for drinks, and knit sweaters\r\n                together, unless we don’t send over the monthly report with goal completion. Therefore, we track\r\n                progress, analyze data, and send monthly reports that provide insights and celebrate successes. Our\r\n                ultimate goal is to help you achieve higher ROI, and we\'re committed to doing whatever it takes to get\r\n                you there (WHATEVER IT TAKES!).'),
(1826, 120, '_prtnr_process_3_description', 'field_641df8c90bf8a'),
(1827, 120, 'prtnr_process_4_title', 'RESULT'),
(1828, 120, '_prtnr_process_4_title', 'field_641df8ee0bf8d'),
(1829, 120, 'prtnr_process_4_description', ' Our team of highly qualified and somewhat crazy specialists hit the labs to develop a vaccine for all\r\n                the pain points of your business. We brainstorm ideas, analyze data, take a lot of paracetamol, and come\r\n                up with a custom plan that delivers results and sets you apart.'),
(1830, 120, '_prtnr_process_4_description', 'field_641df8d30bf8b'),
