(53, 1, '2023-03-24 19:39:21', '2023-03-24 19:39:21', '<style>\r\n#wpcf7-f53-o1 p { width: 100% } #wpcf7-f53-o1 span.wpcf7-not-valid-tip { text-align: left; }\r\n</style>\r\n\r\n<div class=\"row\">\r\n        <div class=\"col-lg-4 col-md-6 offset-lg-2\">\r\n          <div class=\"input-group\">[text* your-name class:form-control placeholder \"Your Name\"]</div>\r\n        </div>\r\n        <div class=\"col-lg-4 col-md-6\">\r\n          <div class=\"input-group\">[text company-name class:form-control placeholder \"Company\"]</div>\r\n        </div>\r\n        <div class=\"col-lg-4 col-md-6 offset-lg-2\">\r\n          <div class=\"input-group\">[email* your-email class:form-control placeholder \"Email\"] </div>\r\n        </div>\r\n        <div class=\"col-lg-4 col-md-6\">\r\n          <div class=\"input-group\">[tel your-number class:form-control placeholder \"Phone no.\"]</div>\r\n        </div>\r\n        <div class=\"col-lg-8 offset-lg-2\">\r\n          <div class=\"input-group\">[select* business-type id:list class:ddl-select first_as_label \"What business unit do you want to contact?\" \"One\" \"Two\"]\r\n          </div>\r\n        </div>\r\n        <div class=\"col-lg-8 offset-lg-2\">\r\n          <div class=\"input-group\">[select* business-budget id:list2 class:ddl-select first_as_label \"What is your budget?\" \"One\" \"Two\"]\r\n          </div>\r\n        </div>\r\n<div class=\"col-lg-8 offset-lg-2\">\r\n          <div class=\"input-group\">[select* project-timeframe id:list3 class:ddl-select first_as_label \"What sort of timeframe do you require the campaign within?\" \"One\" \"Two\"]\r\n          </div>\r\n        </div>\r\n        <div class=\"col-lg-8 offset-lg-2\">\r\n          <div class=\"input-group\">[text* project-details class:form-control placeholder \"Project Details\"]\r\n          </div>\r\n        </div>\r\n        <div class=\"col-lg-8 offset-lg-2\">\r\n          <div class=\"input-group mt-3\">\r\n            [submit class:btn class:btn-outline-white \"SEND\"] \r\n          </div>\r\n        </div>\r\n      </div>\n1\n[_site_title]\n[_site_title] <info@convertbunny.com>\nusman@convertbunny.com\nFrom: [your-name] [your-email]\r\n\r\nCompany Name: [company-name]\r\nPhone Number: [your-number]\r\nBusiness Type: [business-type]\r\nBudget: [business-budget]\r\nProject Timeline: [project-timeframe]\r\nProject Details: [project-details]\nReply-To: [your-email]\n\n\n1\n\n[_site_title] \"[your-subject]\"\n[_site_title] <mianrizwan465@gmail.com>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on [_site_title] ([_site_url])\nReply-To: [_site_admin_email]\n\n\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nPlease fill out this field.\nThis field has a too long input.\nThis field has a too short input.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe uploaded file is too large.\nThere was an error uploading the file.\nPlease enter a date in YYYY-MM-DD format.\nThis field has a too early date.\nThis field has a too late date.\nPlease enter a number.\nThis field has a too small number.\nThis field has a too large number.\nThe answer to the quiz is incorrect.\nPlease enter an email address.\nPlease enter a URL.\nPlease enter a telephone number.', 'Contact form', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2023-03-26 14:17:40', '2023-03-26 14:17:40', '', 0, 'http://localhost/convert_bunny/?post_type=wpcf7_contact_form&#038;p=53', 0, 'wpcf7_contact_form', '', 0),
